import React, {useState,useEffect} from 'react';
import classes from '../../../CSS/GameStyle.module.css'
import padContext from '../../Context/Pad-context'
const LogicContainers = props =>{
    
    let pushpuzzle = (
        <ul className={classes.GameComp} >
            {props.Data.map((val,index)=>{
                const status = null;
                const Input=(inputVal)=>{
                    if(val==null){
                        status = "dynamic"
                    }
                    else{
                        status = "static"
                    }
                }
                return(
                <li key={index} status={status} id={index} onClick={props.Onclick} >{val}</li>
                )
            })}
        </ul>
    )
    return(
        <div>
            {pushpuzzle}
            
        </div>
    )

}
export default LogicContainers;
